{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/williamstubblefield/a-case-study-on-bellabeat-active-technology?scriptVersionId=147748536\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"e4e0123b","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.018353,"end_time":"2023-10-23T20:54:10.505775","exception":false,"start_time":"2023-10-23T20:54:10.487422","status":"completed"},"tags":[]},"source":["![](https://i.ibb.co/bLdYwc8/bellabeatbanner.png)"]},{"cell_type":"markdown","id":"d713a8dc","metadata":{"papermill":{"duration":0.014432,"end_time":"2023-10-23T20:54:10.536336","exception":false,"start_time":"2023-10-23T20:54:10.521904","status":"completed"},"tags":[]},"source":["# Introduction\n","This case study forms an integral part of my involvement in the 'Google Data Analytics Professional Certificate' capstone project. Within this context, I have been tasked with conducting an in-depth data analysis for 'Bellabeat,' a forward-thinking wellness company driven by technology. Bellabeat is dedicated to crafting innovative products specifically tailored to women, aimed at fostering and promoting healthy lifestyle choices. Their range of smart devices encompasses activity tracking, sleep monitoring, stress management, and reproductive health monitoring, among other features.\n","\n","In an effort to facilitate the company's continued growth and development, Bellabeat has expressed a keen interest in gaining insights into how individuals utilize their smart devices. Their overarching objective is to receive high-level recommendations that can inform their marketing strategy. To address these critical business inquiries effectively, I intend to adhere to a structured approach, encompassing six distinct phases of data analysis: **Ask, Prepare, Process, Analyze, Share,** and **Act**.\n","\n","#### About the company\n","Urška Sršen and Sando Mur co-founded Bellabeat, an innovative tech company specializing in the production of health-oriented smart products. Leveraging Sršen's artistic background, Bellabeat has masterfully combined technology with aesthetics to create elegantly designed devices that serve as a source of information and inspiration for women worldwide. These products collect crucial data on various aspects of women's health, including activity, sleep, stress levels, and reproductive health. Since its establishment in 2013, Bellabeat has experienced rapid growth and firmly established itself as a leading tech-driven wellness company catering to the unique needs of women.\n","\n","By 2016, Bellabeat had expanded its global footprint, establishing offices across the world and introducing a range of new products. In addition to their e-commerce platform, Bellabeat's products became readily accessible through a growing network of online retailers. The company's marketing approach has evolved to embrace both traditional and digital channels. While Bellabeat has made investments in conventional advertising mediums such as radio, billboards, print, and television, the company's primary focus is on digital marketing. Bellabeat maintains a continuous presence on Google Search, actively manages engaging Facebook and Instagram pages, and maintains a consistent presence on Twitter. Furthermore, the company employs video advertisements on YouTube and deploys display ads on the Google Display Network to support campaigns centered around key marketing events.\n","\n","Recognizing the wealth of untapped potential within Bellabeat's consumer data, Sršen has tasked the marketing analytics team with a specific mission. They are to concentrate their efforts on a select Bellabeat product and thoroughly analyze the usage data of smart devices, aiming to uncover valuable insights into how individuals are currently utilizing these devices. Armed with this valuable information, Sršen seeks high-level recommendations that can effectively shape and enhance Bellabeat's marketing strategy in alignment with emerging trends and consumer preferences."]},{"cell_type":"markdown","id":"2ed5e6c6","metadata":{"papermill":{"duration":0.014304,"end_time":"2023-10-23T20:54:10.565036","exception":false,"start_time":"2023-10-23T20:54:10.550732","status":"completed"},"tags":[]},"source":["# 1. **ASK**ing Questions to make Data-Driven Decisions"]},{"cell_type":"markdown","id":"bfa76e4f","metadata":{"papermill":{"duration":0.015195,"end_time":"2023-10-23T20:54:10.594623","exception":false,"start_time":"2023-10-23T20:54:10.579428","status":"completed"},"tags":[]},"source":["### Business Task\n","Analyze smart device data to gain insights into how consumers use smart devices and provide recommendations for marketing strategy. The business task includes the following questions:\n","\n","+ What are some trends in smart device usage?\n","+ How could these trends apply to Bellabeat customers?\n","+ How could these trends help influence Bellabeat marketing strategy?\n","\n","### Stakeholders\n","+ Urška Sršen: Bellabeat’s co-founder and Chief Creative Officer.\n","+ Sando Mur: Mathematician and Bellabeat’s co-founder; also, a key member of the Bellabeat executive team.\n","+ Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy."]},{"cell_type":"markdown","id":"5565302c","metadata":{"papermill":{"duration":0.014223,"end_time":"2023-10-23T20:54:10.623331","exception":false,"start_time":"2023-10-23T20:54:10.609108","status":"completed"},"tags":[]},"source":["# 2. **PREPARE** Data for Exploration"]},{"cell_type":"markdown","id":"382906fd","metadata":{"papermill":{"duration":0.014286,"end_time":"2023-10-23T20:54:10.651863","exception":false,"start_time":"2023-10-23T20:54:10.637577","status":"completed"},"tags":[]},"source":["### About the Data\n","This Kaggle dataset provides a comprehensive compilation of personal fitness tracker data obtained from a group of 30 Fitbit users who voluntarily participated in this data collection endeavor. These individuals willingly granted permission for the submission of their personal tracker data, which encompasses minute-level records for a variety of health-related metrics, including physical activity, heart rate, and sleep monitoring. Beyond these detailed measurements, the dataset also encompasses broader insights into daily activity patterns, step counts, and heart rate readings, offering a holistic view of the users' lifestyle and exercise habits.\n","\n","The data collection period spanned from April 12, 2016, to May 12, 2016, providing a snapshot of one month's worth of user activity and health tracking. To facilitate comprehensive analysis, this dataset is presented in a versatile manner, with a total of 18 .CSV files available. These files are structured in both wide and long formats, accommodating various analytical needs and preferences. This wealth of data serves as a valuable resource for researchers, analysts, and enthusiasts seeking to explore and derive meaningful insights from the daily routines and health behaviors of the participating Fitbit users."]},{"cell_type":"markdown","id":"eaffa8c9","metadata":{"papermill":{"duration":0.014509,"end_time":"2023-10-23T20:54:10.680743","exception":false,"start_time":"2023-10-23T20:54:10.666234","status":"completed"},"tags":[]},"source":["### Loading Packages\n","\n","To initiate our analytical process, I'll commence by preparing our workspace. This involves loading crucial R libraries that serve specific purposes in enhancing the efficiency and effectiveness of our data analysis. The choice of libraries is deliberate and tailored to meet distinct needs within our analysis: tidyverse for a consistent and efficient workflow, lubridate to address date and time formatting, dplyr for data manipulation, ggplot2 for visualizing data, and tidyr for data tidying and reshaping. \n","\n","Following the library loading phase, we'll proceed to import our datasets, bringing the raw data into our R environment. This step marks the initial transition from data preparation to analysis, laying the foundation for the comprehensive exploration and insights generation that will follow."]},{"cell_type":"markdown","id":"57cbbb2f","metadata":{"papermill":{"duration":0.01475,"end_time":"2023-10-23T20:54:10.710623","exception":false,"start_time":"2023-10-23T20:54:10.695873","status":"completed"},"tags":[]},"source":["#### > *Loading Libraries*"]},{"cell_type":"code","execution_count":1,"id":"8e69a700","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:10.745066Z","iopub.status.busy":"2023-10-23T20:54:10.742041Z","iopub.status.idle":"2023-10-23T20:54:11.967713Z","shell.execute_reply":"2023-10-23T20:54:11.96563Z"},"papermill":{"duration":1.245569,"end_time":"2023-10-23T20:54:11.970423","exception":false,"start_time":"2023-10-23T20:54:10.724854","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n"]}],"source":["# Loading essential R libraries for data analysis: tidyverse, lubridate, dplyr, ggplot2, tidyr.\n","\n","library(tidyverse)\n","library(lubridate)\n","library(dplyr)\n","library(ggplot2)\n","library(tidyr)"]},{"cell_type":"markdown","id":"1e63597c","metadata":{"papermill":{"duration":0.014226,"end_time":"2023-10-23T20:54:11.999452","exception":false,"start_time":"2023-10-23T20:54:11.985226","status":"completed"},"tags":[]},"source":["#### > *Importing Data*"]},{"cell_type":"markdown","id":"44c786ec","metadata":{"papermill":{"duration":0.014517,"end_time":"2023-10-23T20:54:12.028392","exception":false,"start_time":"2023-10-23T20:54:12.013875","status":"completed"},"tags":[]},"source":["As for my analysis goes, I reviewed some of the .CSV files in Excel first. Trying to get a look into each file to see how it's organized, stored, and what each file brings me. This will help me provide a better foundation for my analysis, and give me better insights into any correlations between calorie trends, sleep patterns, and activity levels. \n","​\n","*  Look at daily and hourly user information for sleep patterns, predefined activity levels, steps, and calorie levels.\n","*  One thing that I noticed prior to loading the dataframes was the file size. The weightLogInfo_merged.csv file size was really low and jumped out to me. I took a look at it in Excel first to get a little insight prior to uploading. In Excel, I used some advanced filters to find a total of 8 unique records (8 out of 33 participants).\n","\n","![](https://i.ibb.co/NZSwYsS/weight1.png)\n","*Advanced filtering to look at unique records on 