"completed"},"tags":[]},"source":["**Insights:** Upon initial assessment of the dataset, I've observed that it adheres to a fairly standard structure. However, a notable aspect that immediately catches my attention is the format of the date and time entries. It's apparent that some adjustments will be necessary in this regard to ensure uniformity and consistency throughout the dataset during the data cleaning process.\n","\n","Addressing the date and time format is crucial for maintaining data integrity and facilitating efficient analysis. Therefore, as part of the data preprocessing and cleaning phase, I will dedicate attention to harmonizing the date/time entries, ensuring that they align seamlessly, and are ready for robust analysis. This meticulous approach will ultimately contribute to the accuracy and reliability of the insights we can derive from this dataset."]},{"cell_type":"markdown","id":"a7b529fe","metadata":{"papermill":{"duration":0.021313,"end_time":"2023-10-23T20:54:13.056495","exception":false,"start_time":"2023-10-23T20:54:13.035182","status":"completed"},"tags":[]},"source":["**Verifying Data Integrity**\n","+ Accessibility: The dataset is openly accessible without copyright restrictions, allowing unrestricted usage.\n","+ Reliability: Data collection via Amazon Mechanical Turk introduces uncertainty about its reliability, as it may originate from third-party sources.\n","+ Comprehension: Lack of metadata detailing data collection methods and units of measurement necessitates reliance on an external FitBit metadata file from a Kaggle user for guidance.\n","\n","**Limitations of the Dataset**\n","+ Incompleteness: Not all 33 participants have recorded their weight or sleep data within the app.\n","+ Weight Data: The weight dataset comprises information from only eight users, potentially rendering recommendations biased and non-representative of the broader population.\n","+ Exclusion: Due to limited data in the weight dataset, it will not be included in the analysis to ensure robust and unbiased results for the general public."]},{"cell_type":"markdown","id":"73f4b004","metadata":{"papermill":{"duration":0.020837,"end_time":"2023-10-23T20:54:13.098644","exception":false,"start_time":"2023-10-23T20:54:13.077807","status":"completed"},"tags":[]},"source":["# 3. **PROCESS** Data from Dirty to Clean"]},{"cell_type":"markdown","id":"ccbdefeb","metadata":{"papermill":{"duration":0.020593,"end_time":"2023-10-23T20:54:13.139783","exception":false,"start_time":"2023-10-23T20:54:13.11919","status":"completed"},"tags":[]},"source":["#### NA Values\n","\n","Conducting a thorough examination of dataframes to detect the presence of NA values, which yields a FALSE result when none are identified, ensures data integrity and reliability."]},{"cell_type":"code","execution_count":7,"id":"fcf8a031","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:13.18516Z","iopub.status.busy":"2023-10-23T20:54:13.183426Z","iopub.status.idle":"2023-10-23T20:54:13.242044Z","shell.execute_reply":"2023-10-23T20:54:13.24011Z"},"papermill":{"duration":0.084065,"end_time":"2023-10-23T20:54:13.244674","exception":false,"start_time":"2023-10-23T20:54:13.160609","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["FALSE"],"text/latex":["FALSE"],"text/markdown":["FALSE"],"text/plain":["[1] FALSE"]},"metadata":{},"output_type":"di