],"source":["# https://www.statology.org/summary-function-in-r/\n","\n","# Hourly Calorie quick review\n","hourly_calories %>%  \n","  select(Calories) %>%\n","  summary()\n","\n","# Daily Calorie quick review\n","daily_calories %>%  \n","  select(Calories) %>%\n","  summary()\n","\n","# Hourly Steps quick review\n","hourly_steps %>%  \n","  select(StepTotal) %>%\n","  summary()\n","\n","# Daily Steps quick review\n","daily_steps %>%  \n","  select(StepTotal) %>%\n","  summary()\n","\n","# Daily Activity level per participant\n","daily_activity %>%\n","  select(LightlyActiveMinutes, FairlyActiveMinutes, VeryActiveMinutes) %>%\n","  summary()\n","\n","# Hourly Intensity quick review\n","hourly_intensities %>%  \n","  select(TotalIntensity) %>%\n","  summary()\n","\n","# Daily Intensity quick review\n","daily_intensities %>%  \n","  select(SedentaryMinutes, LightlyActiveMinutes, FairlyActiveMinutes, VeryActiveMinutes) %>%\n","  summary()\n","\n","# Sleep Pattern Review\n","sleep %>%\n","  select(TotalSleepRecords, TotalMinutesAsleep, TotalTimeInBed) %>%\n","  summary()\n","\n","# weight\n","weight %>%\n","  select(WeightKg, BMI) %>%\n","  summary()"]},{"cell_type":"markdown","id":"a3370f83","metadata":{"papermill":{"duration":0.024587,"end_time":"2023-10-23T20:54:14.286432","exception":false,"start_time":"2023-10-23T20:54:14.261845","status":"completed"},"tags":[]},"source":["Instead of running individual MIN, MAX, and AVERAGE calculations for each dataset, I utilized the `summary()` function to gain a comprehensive overview.\n","\n","The summary has yielded valuable insights:\n","+ Daily calorie intake averages at 2304, surpassing the recommended 2000 daily calories. Notably, at 2793 calories, there appears to be a trend of increased calorie burning later in the day, potentially valuable for marketing campaign timing.\n","+ Daily step counts look promising with an average of 7638. Interestingly, there's a pattern of higher activity during the later part of the day, reaching an average of 10727 steps.\n","+ When examining intensity levels, both light activity and very active minutes exceed fairly active minutes. While the implications are not entirely clear, it seems people tend to be either active or lightly active, with less activity in the middle range.\n","+ Sedentary (somewhat inactive) behavior appears prevalent, averaging 991 minutes per day (equivalent to 16.5 hours per day). This high sedentary time highlights the need for strategies to motivate more movement.\n","+ Daily intensity patterns align with the activity level observations, reinforcing the trend of increased activity during the later part of the day.\n","+ Further analysis involves comparing differences between time spent in bed and the time it takes to fall asleep.\n","\n","This structured presentation provides a clearer and organized breakdown of the insights obtained from the dataset summary."]},{"cell_type":"markdown","id":"e1e5b048","metadata":{"papermill":{"duration":0.024548,"end_time":"2023-10-23T20:54:14.335856","exception":false,"start_time":"2023-10-23T20:54:14.311308","status":"completed"},"tags":[]},"source":["**Analyzing Steps and Calories**\n","+ How many steps do our users take daily? \n","+ How active are they? \n","+ Does the total number of steps have any correlation to the amount of burned calories?"]},{"cell_type":"code","execution_count":12,"id":"06db33a9","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:14.390129Z","iopub.status.busy":"2023-10-23T20:54:14.388454Z","iopub.status.idle":"2023-10-23T20:54:14.419117Z","shell.execute_reply":"2023-10-23T20:54:14.417253Z"},"papermill":{"duration":0.060765,"end_time":"2023-10-23T20:54:14.421764","exception":false,"start_time":"2023-10-23T20:54:14.360999","status":"completed"},"tags":[]},"outputs":[{"data":{"text/plain":["    Calories   \n"," Min.   :   0  \n"," 1st Qu.:1828  \n"," Median :2134  \n"," Mean   :2304  \n"," 3rd Qu.:2793  \n"," Max.   :4900  "]},"metadata":{},"output_type":"display_data"},{"data":{"text/plain":["   StepTotal    \n"," Min.   :    0  \n"," 1st Qu.: 3790  \n"," Median : 7406  \n"," Mean   : 7638  \n"," 3rd Qu.:10727  \n"," Max.   :36019  "]},"metadata":{},"output_type":"display_data"}],"source":["# https://www.statology.org/summary-function-in-r/\n","\n","# Daily Calorie quick review\n","daily_calories %>%  \n","  select(Calories) %>%\n","  summary()\n","\n","# Daily Steps quick review\n","daily_steps %>%  \n","  select(StepTotal) %>%\n","  summary()"]},{"cell_type":"markdown","id":"5fd17af3","metadata":{"papermill":{"duration":0.025547,"end_time":"2023-10-23T20:54:14.472272","exception":false,"start_time":"2023-10-23T20:54:14.446725","status":"completed"},"tags":[]},"source":["**Efficient Analysis:** To assess general fitness, it's common knowledge that the target is typically set at 10,000 steps per day for adults, and dipping below 5,000 steps often signifies a sedentary lifestyle. However, it's essential to acknowledge that the ideal step count can vary based on age, current fitness levels, and individual health goals, as outlined by the Centers for Disease Control and Prevention (CDC).\n","\n","The data indicates that the users in our study have an average daily step count of 7,638 steps. To better gauge their activity levels, we can categorize daily steps as follows:\n","+ **Sedentary:** Less than 5,000 steps/day\n","+ **Less Active:** Between 5,001 and 7,500 steps/day\n","+ **Active:** Between 7,501 and 10,000 steps/day\n","+ **Very Active:** More than 10,001 steps/day\n","\n","Given this categorization, our users predominantly fall into the \"Active\" category. It's evident that there is room for improvement in terms of their daily step count to optimize their health and overall well-being.\n","\n","Walking, a low-impact and moderately intense exercise, offers a myriad of health benefits with minimal risks. Hence, aligning with CDC recommendations, most adults should aim for approximately 10,000 steps daily, roughly equivalent to covering about 5 miles. This efficient approach underscores the significance of striving for this step count to attain favorable health outcomes."]},{"cell_type":"markdown","id":"c33075db","metadata":{"papermill":{"duration":0.026064,"end_time":"2023-10-23T20:54:14.523634","exception":false,"start_time":"2023-10-23T20:54:14.49757","status":"completed"},"tags":[]},"source":["# 5. SHARE Insights"]},{"cell_type":"code","execution_count":13,"id":"af3f1907","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:14.576894Z","iopub.status.busy":"2023-10-23T20:54:14.575227Z","iopub.status.idle":"2023-10-23T20:54:16.867578Z","shell.execute_reply":"2023-10-23T20:54:16.864747Z"},"papermill":{"duration":2.32727,"end_time":"2023-10-23T20:54:16.875647","exception":false,"start_time":"2023-10-23T20:54:14.548377","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAB4AAAAaQCAIAAAAFYdS+AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5xcZaE/4HdmWzY9JIQOwUBoBqQTilTpAnIBhYvlWrmKoIIIYgHUiyIgCIIF\nRe6FUKReEOGnNBHwUgIiSAxoIKSxJNlM3dlp5/fHwhLTSNmzZ8vz/MGHfc+ZM9+dOdmd+e47\n70lFURQAAAAAAKCnpZMOAAAAAADAwKSABgAAAAAgFgpoAAAAAABioYAGAAAAACAWCmgAAAAA\nAGKhgAYAAAAAIBYKaAAAAAAAYqGABgAAAAAgFgO8gH7yy5NTq+Cov7wZX4bnf7BrKpU68K5X\nV75brTTrlxd+5QN7br/umJFNjc0jx264835HffOKWzK1KL5s/VFUy9151QXHH7zHJuuPa21q\nHrXO+B33PuTsS69fUKmvwdFW8dlZFc+c875UKnXYI3PX/lAAAAAAMDA0Jh0gXkPGbbrFFqXu\nL6N64R//nJdKNU6cOGHJ3TZoaXjXQ0X1wuNPPNfYsunuu2zS4znzs367/y7HP/1mRyrdvP6m\nm++81chs26xn/3jPtEfuvuKK63//9K27jmzuhRh9X2HOgx/a+5jfv5oLIbSMGLv+RustfmPe\nc4/9v+ce+39XXfHr+56+Z8+xQ5LOCAAAAAC8ZYAX0Nuf+9uXz33ny1L7va3rHJFuWvfll19e\n3UNVO2bsvffeIzf9Zua1C3oyYgghKn9yykeefrNj6+O+eeuV52y3XmvX8KIZf/r6p0/42aN3\nH7bPNxb85aLYY/R51Y6/H/LeIx5bXNpsv09e/YNzDtttixBCqHf89eG7vv2lL9zx1wcO3+3z\nb7zyq5ZUMvEmHP+dX2+9aKOtxyRz9wAAAADQ9wzwJTj6hcyrF/xmbn7ImIOevvn87vY5hLDO\npL2v+sMzOwxvXvj8D384O5dgwj7iumM/8Nji0saHnj/9gV++1T6HENKtkw/4yG+eem7fUS2Z\nf1772eRWwBi70wc//vGPH7TEMwgAAAAAg5wCOnntzz8RQhi23seHpZee