AAAAAAAFSygAQAAAAAAAAAqWEADAAAAAAAAAFSwgAYAAAAAAAAAqGABDQAAAAAAAABQ\n8f8JLWt0yRR+EgAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"height":840,"width":960}},"output_type":"display_data"}],"source":["int_new <- daily_steps %>%\n","  group_by(Date) %>%\n","  drop_na() %>%\n","  summarise(Steps = mean(StepTotal))\n","\n","ggplot(data = int_new, aes(x = Date, y = Steps)) + \n","  geom_bar(stat = \"identity\", fill = 'darkgreen') + \n","  theme(axis.text.x = element_text(angle = 90)) + \n","  labs(title = \"Steps vs. Day\", x = \"Time\", y = \"Step Total\")"]},{"cell_type":"markdown","id":"543df75d","metadata":{"papermill":{"duration":0.031372,"end_time":"2023-10-23T20:54:18.22601","exception":false,"start_time":"2023-10-23T20:54:18.194638","status":"completed"},"tags":[]},"source":["**In-Depth Analysis:** To gain deeper insights from our dataset, it's crucial to explore the intriguing correlation between average daily step counts and the day of the week. This connection unveils fascinating trends in physical activity patterns, shedding light on how individuals distribute their steps throughout the week and offering valuable insights for health and lifestyle considerations.\n","\n","Let's embark on a comprehensive examination of this correlation:\n","\n","**Average Steps per Day:** Average daily step counts serve as a fundamental metric for understanding individual physical activity levels. This metric encapsulates the cumulative steps taken by users over the course of a day, providing a holistic view of their activity patterns.\n","\n","**Day of the Week vs. Step Counts:** As we delve into the dataset, a compelling correlation emerges between the day of the week and average daily step counts. The data reveals that specific days exhibit higher step counts on average, suggesting distinct activity patterns associated with each day. Notably, Saturday and Thursday emerge as the two days with the highest average step counts.\n","\n","**Factors Influencing Step Counts:** Several factors contribute to the variations in step counts across different days of the week. These factors include:\n","+ **Workweek vs. Weekend:** A common trend is higher step counts on weekends, such as Saturdays, when individuals often have more free time to engage in outdoor activities and leisurely walks.\n","+ **Routine and Habits:** Weekdays may be influenced by work or school routines, which can impact the timing and frequency of physical activity. Understanding how these routines intersect with step counts is essential.\n","+ **Health and Fitness Goals:** Individuals may consciously allocate specific days for more intense workouts or outdoor adventures, leading to variations in step counts based on personal fitness objectives.\n","\n","**Health and Lifestyle Implications:** Recognizing the correlation between day of the week and step counts has significant health and lifestyle implications. It allows individuals to optimize their activity patterns by aligning their goals with the days that naturally exhibit higher step counts. For instance, those aiming for increased physical activity may plan more extensive workouts on Saturdays and Thursdays.\n","\n","**Tailoring Strategies:** Health and wellness professionals can leverage this knowledge to tailor fitness and lifestyle recommendations. By understanding the patterns of higher step counts on certain days, they can guide individuals in creating personalized activity schedules that align with their objectives.\n","\n","In conclusion, the correlation between average steps per day and the day of the week offers valuable insights into user behavior and physical activity patterns. The prominence of Saturdays and Thursdays as the highest step days highlights the significance of these days for physical activity. Leveraging this correlation can empower individuals to make informed choices about when to focus on their fitness goals, ultimately contributing to improved health and well-being."]},{"cell_type":"code","execu