CA2gAAAAAAAAAgENwAA0AAAAAAAAAcAgOoAEA\nAAAAAAAADsEBNAAAAAAAAADAITiABgAAAAAAAAA4xP8B73t4CTe3qtkAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":840,"width":960}},"output_type":"display_data"}],"source":["int_new <- hourly_steps %>%\n","  group_by(Time) %>%\n","  drop_na() %>%\n","  summarise(Steps = mean(StepTotal))\n","\n","ggplot(data = int_new, aes(x = Time, y = Steps)) + \n","  geom_bar(stat = \"identity\", fill = 'orange') + \n","  theme(axis.text.x = element_text(angle = 90)) + \n","  labs(title = \"Steps vs. Activity Hour\", x = \"Time\", y = \"Mean StepTotal\")\n"]},{"cell_type":"markdown","id":"f49bb3a7","metadata":{"papermill":{"duration":0.03392,"end_time":"2023-10-23T20:54:18.812801","exception":false,"start_time":"2023-10-23T20:54:18.778881","status":"completed"},"tags":[]},"source":["**In-Depth Analysis:** To gain a profound understanding of our dataset, it's crucial to delve into the intricate correlation between daily step counts and the time of day when these steps are accumulated. This correlation unravels fascinating trends in physical activity patterns, shedding light on the temporal aspects of individuals' step-count distribution and offering valuable insights into daily routines and health behaviors.\n","\n","Let's embark on an extensive examination of this correlation:\n","\n","**Steps Taken as a Metric:** Daily step counts serve as a fundamental metric for assessing individuals' physical activity levels. These counts encapsulate the total number of steps accumulated throughout the day, providing a comprehensive view of an individual's activity patterns and lifestyle choices.\n","\n","**Time of Day vs. Step Counts:** As we scrutinize the dataset more closely, a compelling correlation unfolds between the time of day and step counts. This relationship reveals that specific hours exhibit higher step counts on average, signifying distinct patterns in physical activity. Remarkably, the data highlights a conspicuous peak in step counts between 5 pm and 7 pm, making this the period with the highest step counts.\n","\n","**Factors Influencing Step Counts by Time of Day:** Several factors contribute to the variations in step counts observed throughout the day. These factors include:\n","+ **Work and Commute:** The morning hours may see lower step counts as individuals typically engage in work-related activities or commute to their workplaces. The evening surge could be attributed to post-work exercise routines and leisurely walks.\n","+ **Circadian Rhythms:** Human energy levels and physical performance often follow natural circadian rhythms. Understanding how these rhythms intersect with step counts provides insights into optimal times for physical activity.\n","+ **Social and Lifestyle Factors:** Social engagements, personal preferences, and leisure activities play a role in dictating when individuals choose to engage in physical activity. The evening spike may coincide with opportunities for recreational activities and exercise.\n","\n","**Health and Lifestyle Implications:** Recognizing the correlation between step counts and time of day holds significant implications for health and lifestyle choices. It enables individuals to align their physical activity routines with their daily schedules, optimizing the timing of workouts and outdoor pursuits for maximum benefits.\n","\n","**Tailoring Activity Plans:** Health and fitness professionals can leverage this knowledge to tailor exercise plans and wellness strategies. Understanding the patterns of higher step counts during specific hours allows for precise recommendations and the development of strategies to encourage physical activity during these times.\n","\n","In conclusion, the correlation between daily step counts and the time of day offers valuable insights into user behavior and physical activity patterns. The pronounced surge in step counts between 5 pm and 7 pm underscores the significance of this evening period for physical activity. Leveraging this correlation empowers individuals to make informed choices about when to prioritize their fitness goals, ultimately contributing to enhanced health and well-being."]},{"cell_type":"code","execution_count":17,"id":"5cf16eab","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:18.880263Z","iopub.status.busy":"2023-10-23T20:54:18.878586Z","iopub.status.idle":"2023-10-23T20:54:19.368914Z","shell.execute_reply":"2023-10-23T20:54:19.365958Z"},"papermill":{"duration":0.528771,"end_time":"2023-10-23T20:54:19.373341","exception":false,"start_time":"2023-10-23T20:54:18.84457","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC0AAAAlgCAIAAACUHiEoAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd5wdVcE/4HO3Zje9QgqBhBJaAAm9GJoIAkIovjQBX1REkKoiGDEgAiK9iaD+\nEpGiKFhQfBEUpPcaaYGEEtJ7283u3vn9ce/O3uxmd+8mmxwwz/PX3DNnZs49c85+Psn53plM\nkiQBAAAAAAAAAIB4SmI3AAAAAAAAAABgXSfAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAA\nAAAAAJEJcAAAAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAA\nAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAAAAAAAAAARCbA\nAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAAAAAAAAAARCbAAQAAAAAAAAAQ\nmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAAAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAA\nAEBkAhwAAAAAAAAAAJEJcAAAAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAA\nAAAAAJEJcAAAAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAA\nAAAAAAAARCbAAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAAAAAAAAAJEJcAAAAAAAAAAARCbA\nAQAAAAAAAAAQmQAHAAAAAAAAAEBkAhwAAADrusVTb8wUuObDRbFb9Em3dnpsxjMHp5eYUtuw\n1o5dBZlWVFR1Hzh8m8NO+s7/TZy3ptvQtie+snmuSVW991uFw+uXvZl+qS++MqvTm7cWfHD/\nKZlMpqSk/I5pS2K3hdW1FgbkgndvyJ3//Menr4nzAwAAsFICHAAAAOu6l8bdVPjx1otfjtWS\nT4tO77HdP7PtyJEjR44c+eV7Jq/mqT4hF8qpq1k8ffJrf5pw5Re23fDsO99cC1dkpRpq3x9z\nzPgQwqC9f3bcwK6xmxPNWh7/n2o9N/7W5aMGhBCu/eIxs+uzsZsDAACwrhDgAAAAWLcldef8\n9r3Cgsm/+259Eqs1nwZroMfeeD3vvbm1q3WiT8yFmsk2LLr+hB3/MGPp2rwoqSfGHvbi4uWZ\nTOaiXx8duy0xxRr/n1Kn3HFmCKFm3iOH/lSqDwAAYC0R4AAAAFinzXv7h88vWl5YUrvw6Usn\nL4jVnk++tdZjA3