DATOAAAAAAAAAA\nAJgJHAAAAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZwAEAAAAAAAAA\nMBM4AAAAAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAAAACYCRwAAAAAAAAAADOBAwAAAAAAAABg\nJnAAAAAAAAAAAMwEDgAAAAAAAACAmcABAAAAAAAAADATOAAAAAAAAAAAZgIHAAAAAAAAAMBM\n4AAAAAAAAAAAmAkcAAAAAAAAAAAzgQMAAAAAAAAAYCZwAAAAAAAAAADMBA4AAAAAAAAAgJnA\nAQAAAAAAAAAwEzgAAAAAAAAAAGYCBwAAAAAAAADATOAAAAAAAAAAAJgJHAAAAAAAAAAAM4ED\nAAAAAAAAAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZwAEAAAAAAAAAMBM4AAAAAAAAAABmAgcA\nAAAAAAAAwEzgAAAAAAAAAACYCRwAAAAAAAAAADOBAwAAAAAAAABgJnAAAAAAAAAAAMwEDgAA\nAAAAAACAmcABAAAAAAAAADATOAAAAAAAAAAAZgIHAAAAAAAAAMBM4AAAAAAAAAAAmAkcAAAA\nAAAAAAAzgQMAAAAAAAAAYCZwAAAAAAAAAADMBA4AAAAAAAAAgJnAAQAAAAAAAAAwEzgAAAAA\nAAAAAGYCBwAAAAAAAADATOAAAAAAAAAAAJgJHAAAAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAA\nAAAAzAQOAAAAAAAAAICZwAEAAAAAAAAAMBM4AAAAAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAA\nAACYCRwAAAAAAAAAADOBAwAAAAAAAABgJnAAAAAAAAAAAMwEDgAAAAAAAACAmcABAAAAAAAA\nADATOAAAAAAAAAAAZgIHAAAAAAAAAMBM4AAAAAAAAAAAmAkcAAAAAAAAAAAzgQMAAAAAAAAA\nYCZwAAAAAAAAAADMBA4AAAAAAAAAgJnAAQAAAAAAAAAwEzgAAAAAAAAAAGYCBwAAAAAAAADA\nTOAAAAAAAAAAAJgJHAAAAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZ\nwAEAAAAAAAAAMBM4AAAAAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAAAACYCRwAAAAAAAAAADOB\nAwAAAAAAAABgJnAAAAAAAAAAAMwEDgAAAAAAAACAmcABAAAAAAAAADATOAAAAAAAAAAAZgIH\nAAAAAAAAAMBM4AAAAAAAAAAAmAkcAAAAAAAAAAAzgQMAAAAAAAAAYCZwAAAAAAAAAADMBA4A\nAAAAAAAAgJnAAQAAAAAAAAAwEzgAAAAAAAAAAGYCBwAAAAAAAADATOAAAAAAAAAAAJgJHAAA\nAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZwAEAAAAAAAAAMBM4AAAA\nAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAAAACYCRwAAAAAAAAAADOBAwAAAAAAAABgJnAAAAAA\nAAAAAMwEDgAAAAAAAACAmcABAAAAAAAAADATOAAAAAAAAAAAZgIHAAAAAAAAAMBM4AAAAAAA\nAAAAmAkcAAAAAAAAAAAzgQMAAAAAAAAAYCZwAAAAAAAAAADMBA4AAAAAAAAAgJnAAQAAAAAA\nAAAwEzgAAAAAAAAAAGYCBwAAAAAAAADATOAAAAAAAAAAAJgJHAAAAAAAAAAAM4EDAAAAAAAA\nAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZwAEAAAAAAAAAMBM4AAAAAAAAAABmAgcAAAAAAAAA\nwEzgAAAAAAAAAACYCRwAAAAAAAAAADOBAwAAAAAAAABgJnAAAAAAAAAAAMwEDgAAAAAAAACA\nmcABAAAAAAAAADATOAAAAAAAAAAAZgIHAAAAAAAAAMBM4AAAAAAAAAAAmAkcAAAAAAAAAAAz\ngQMAAAAAAAAAYCZwAAAAAAAAAADMBA4AAAAAAAAAgJnAAQAAAAAAAAAwEzgAAAAAAAAAAGYC\nBwAAAAAAAADATOAAAAAAAAAAAJgJHAAAAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAAAAAAzAQO\nAAAAAAAAAICZwAEAAAAAAAAAMBM4AAAAAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAAAACYCRwA\nAAAAAAAAADOBAwAAAAAAAABgJnAAAAAAAAAAAMwEDgAAAAAAAACAmcABAAAAAAAAADATOAAA\nAAAAAAAAZgIHAAAAAAAAAMBM4AAAAAAAAAAAmAkcAAAAAAAAAAAzgQMAAAAAAAAAYCZwAAAA\nAAAAAADMBA4AAAAAAAAAgJnAAQAAAAAAAAAwEzgAAAAAAAAAAGYCBwAAAAAAAADATOAAAAAA\nAAAAAJgJHAAAAAAAAAAAM4EDAAAAAAAAAGAmcAAAAAAAAAAAzAQOAAAAAAAAAICZwAEAAAAA\nAAAAMBM4AAAAAAAAAABmAgcAAAAAAAAAwEzgAAAAAAAAAACYCRwAAAAAAAAAADOBAwAAAAAA\nAABgJnAAAAAAAAAAAMwEDgAAAAAAAACAmcABAAAAAAAAADATOAAAAAAAAAAAZgIHAAAAAAAA\nAMBM4AAAAAAAAAAAmAkcAAAAAAAAAACzAC43AW7TdjFHAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":1200,"width":1440}},"output_type":"display_data"}],"source":["# Calculate the average of the specified columns\n","average_activity <- daily_activity %>%\n","  summarise(\n","    Sedentary = (mean(SedentaryMinutes) / 60) / 24 * 100,  # Convert to percentage of a day\n","    LightlyActive = (mean(LightlyActiveMinutes) / 60) / 24 * 100,  # Convert to percentage of a day\n","    FairlyActive = (mean(FairlyActiveMinutes) / 60) / 24 * 100,  # Convert to percentage of a day\n","    VeryActive = (mean(VeryActiveMinutes) / 60) / 24 * 100  # Convert to percentage of a day\n","  )\n","\n","# Create a vector of average values and labels with rounded percentages\n","activity_values <- unlist(average_activity)\n","activity_labels <- paste(names(activity_values), \"\\n\", round(activity_values, 2), \"\", sep = \"\")\n","\n","# Increase the size of the pie chart\n","options(repr.plot.width = 24, repr.plot.height = 20)\n","\n","# Create a larger pie chart with average percentages of a day in the labels\n","pie(activity_values, labels = activity_labels, col = rainbow(length(activity_values)))\n","\n","# Add a title\n","title(\"Average Activity Breakdown (percent per day)\")"]},{"cell_type":"markdown","id":"82673f01","metadata":{"papermill":{"duration":0.033836,"end_time":"2023-10-23T20:54:19.441831","exception":false,"start_time":"2023-10-23T20:54:19.407995","status":"completed"},"tags":[]},"source":["**Comprehensive Analysis of Activity Levels:**\n","Employing a pie chart to represent activity levels per day in percentages provides a visual and insightful perspective on how individuals allocate their time throughout a 24-hour period. This visualization, which encompasses four distinct activity categories—Sedentary, LightlyActive, FairlyActive, and VeryActive—unveils intriguing patterns in daily routines and highlights the multifaceted nature of human activity.\n","\n","**Understanding the Pie Chart:**\n","+ **Sedentary:** The \"Sedentary\" category represents periods of low physical activity, such as sitting or resting. These segments of inactivity are essential for rest and recovery but should be balanced with more active intervals.\n","+ **LightlyActive:** \"LightlyActive\" segments encompass activities that involve minimal exertion, such as casual walking or light household chores. These periods contribute to overall daily movement and energy expenditure.\n","+ **FairlyActive:** The \"FairlyActive\" category signifies moderately active intervals, which may include activities like brisk walking, moderate housework, or light exercise. These segments promote cardiovascular health and calorie burn.\n","+ **VeryActive:** \"VeryActive\" segments represent high-intensity physical activity, such as vigorous exercise, running, or engaging in sports. These periods are crucial for cardiovascular fitness and calorie expenditure.\n","\n","**Pie Chart Insights:**\n","+  The pie chart reveals a dynamic distribution of activity levels throughout the day, showcasing the ebb and flow of physical exertion. It's important to note that the percentages do not sum up to 100% of a 24-hour day, emphasizing the coexistence of various activity levels within a daily routine.\n","\n","**Implications and Takeaways:**\n","+ The presence of \"Sedentary\" and \"LightlyActive\" segments suggests that individuals incorporate rest and light activities into their daily schedules, which is crucial for overall well-being.\n","+ The \"FairlyActive\" category signifies that individuals engage in moderate physical activity regularly, contributing to cardiovascular fitness and health.\n","+ The presence of \"VeryActive\" segments highlights that vigorous exercise and high-intensity activities are integral parts of daily routines, promoting cardiovascular health and calorie expenditure.\n","\n","**Recommendations:**\n","+ This pie chart underscores the importance of balance in daily activity levels. It encourages individuals to integrate a variety of activities, including rest, light movement, moderate exercise, and vigorous workouts, into their daily schedules.\n","+ Striking a balance between these activity categories can contribute to overall health, fitness, and well-being.\n","\n","In conclusion, the pie chart depicting activity levels per day in percentages provides a holistic view of how individuals allocate their time and energy throughout a 24-hour period. It underscores the multifaceted nature of human activity, emphasizing the importance of a balanced approach to daily routines that encompasses rest, light activities, moderate exercise, and vigorous physical exertion."]},{"cell_type":"code","execution_count":18,"id":"cbda7719","metadata":{"execution":{"iopub.execute_input":"2023-10-23T20:54:19.513613Z","iopub.status.busy":"2023-10-23T20:54:19.511737Z","iopub.status.idle":"2023-10-23T20:54:20.158932Z","shell.execute_reply":"2023-10-23T20:54:20.15597Z"},"papermill":{"duration":0.688785,"end_time":"2023-10-23T20:54:20.164202","exception":false,"start_time":"2023-10-23T20:54:19.475417","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC0AAAAlgCAIAAACUHiEoAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZzd0/0/8PO5d9bMZB+JiEhkkViSEEREVAlVba0V